import React from 'react';
import '../App.css';

export default function HomeTopBanner() {
    return (
      <>
  
  
        <div className='home-top-banner'>
            <div className='home-top-banner-slogan'>
                Leading-Edge Tools, Technology,<br/>
                and Expertise in Cybersecurity
            </div>
            
            <div className='home-top-banner-sub-slogan'>
                <h1>
                We provide secure, customizable solutions that identify and remediate threats, maintain consistent connectivity at your edge locations, and deliver expert technical support.

                </h1>
            </div>
        </div>
        
      </>
    );
  }
